import React, { useState } from 'react';

const PropertyForm = () => {
  const [houseNumber, setHouseNumber] = useState('');
  const [rent, setRent] = useState('');
  const [rooms, setRooms] = useState('');
  const [status, setStatus] = useState('');

  const handleSubmit = () => {
    // Handle form submission (you can save the data to a backend or local storage for now)
    console.log('Property Added:', { houseNumber, rent, rooms, status });
  };

  return (
    <div>
      <h2>Add New Property</h2>
      <input type="text" placeholder="House Number" value={houseNumber} onChange={(e) => setHouseNumber(e.target.value)} />
      <input type="number" placeholder="Rent" value={rent} onChange={(e) => setRent(e.target.value)} />
      <input type="number" placeholder="Rooms" value={rooms} onChange={(e) => setRooms(e.target.value)} />
      <select value={status} onChange={(e) => setStatus(e.target.value)}>
        <option value="">Select Status</option>
        <option value="available">Available</option>
        <option value="rented">Rented</option>
      </select>
      <button onClick={handleSubmit}>Submit</button>
    </div>
  );
};

export default PropertyForm;
